import React from 'react';
import '../styles/Calendario.css'; // Asegúrate de que exista el archivo Calendario.css o crea uno en la carpeta styles

function Calendario() {
  return (
    <div className="calendario">
      <h2>Pantalla de Calendario</h2>
      <p>Aquí podrás ver tus eventos sincronizados con Google Calendar.</p>
    </div>
  );
}

export default Calendario;
